webpackJsonp([0x6b1f975b7490],{395:function(e,i){e.exports={data:{site:{siteMetadata:{title:"keto.nyc",author:"Una Kravets"}},markdownRemark:{id:"/Users/unakravets/Dev/keto.nyc/src/pages/2018-08-25-cheddar-cloud-biscuits-with-lox/index.md absPath of file >>> MarkdownRemark",html:'<h2>You’ll Need:</h2>\n<h3>Cloud biscuit</h3>\n<ul>\n<li>3/4 cup sharp cheddar cheese</li>\n<li>4 oz almond flour</li>\n<li>1 tsp baking powder</li>\n<li>1 tsp chili powder</li>\n<li>1 egg</li>\n<li>1 tablespoon heavy cream</li>\n</ul>\n<h3>Toppings (Each Sandwich)</h3>\n<ul>\n<li>1oz smoked salmon (lox)</li>\n<li>1oz cream cheese spread (full fat)</li>\n<li>squeeze of lemon (optional)</li>\n<li>arugula (rocket)</li>\n</ul>\n<h2>Directions:</h2>\n<ol>\n<li>Preheat oven to 350°F</li>\n<li>Add almond flour, baking powder, chili powder, and cheese to a bowl. Stir.</li>\n<li>Make a hole in the bowl with the flour and cheese. Drop in the egg and cream. Mix together.</li>\n<li>Scoop out mixture and form patties on a baking sheet.</li>\n<li>Place in the oven for 15 minutes. Once done, leave to cool for a minute or two and then slice each biscuit in half.</li>\n<li>Build the sandwich. Add cream cheese, leaves and lox.</li>\n</ol>\n<p><small>Adopted from <a href="https://fitmencook.com/keto-meal-plan/">Fit Man Kitchen 4-Day Meal Plan</a></small></p>',frontmatter:{date:"August 25, 2018",protein:15.5,funFact:"We had these on a little study day/hackathon",servings:4,netCarbs:4.5,calories:252,fat:42,carbs:6,title:"Cheddar Cloud Biscuits with Lox",fiber:1.5,sugars:0,prepTime:"5 minute",cookTime:"15 minutes",readyTime:"20 minutes",image1:{childImageSharp:{resolutions:{width:800,height:534,src:"/static/cover-504212bb0ebb1c8352ddaf64484891d7-4042a.jpg",srcSet:"/static/cover-504212bb0ebb1c8352ddaf64484891d7-4042a.jpg 1x"}}},image2:{childImageSharp:{resolutions:{width:800,height:534,src:"/static/secondary-1da1dbb2b5b9be89685bf80b0e2adbe8-4042a.jpg",srcSet:"/static/secondary-1da1dbb2b5b9be89685bf80b0e2adbe8-4042a.jpg 1x"}}}}}},pathContext:{slug:"/2018-08-25-cheddar-cloud-biscuits-with-lox/",previous:{fields:{slug:"/2018-08-23-pb-magic-mug-cake/"},frontmatter:{title:"Peanut Butter Protein Magic Mug Cake"}},next:{fields:{slug:"/2018-08-26-garlic-butter-shrimp-zoodles/"},frontmatter:{title:"Garlic Butter Shrimp Zoodles"}}}}}});
